// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "../node_modules/@openzeppelin/contracts/utils/Counters.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "../node_modules/@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "../node_modules/@openzeppelin/contracts/access/Ownable.sol";

/**Working nft simple contract for trading */

contract SimpleMarketPlace {
    
    using Counters for Counters.Counter;
    Counters.Counter private _listingIds;
    Counters.Counter private _itemsSold;

    event TokenListed(address seller, uint256 tokenId, uint256 amount, uint256 price);
    event TokenSold(address seller, address buyer, uint256 tokenId, uint256 amount, uint256 price);

    mapping(uint256 => Listing) idToListing;

    struct Listing {
        address contractAddress;
        address seller;
        uint256 tokenId;
        uint256 price;
    }

    function addListing(address contractAddress, uint256 price, uint256 tokenId) public {
        ERC1155 token = ERC1155(contractAddress);
        require(token.balanceOf(msg.sender, tokenId) > 0, "caller must own given token");
        require(token.isApprovedForAll(msg.sender, address(this)), "Contract must be approved!");

        _listingIds.increment();
        uint256 listingId = _listingIds.current();
        idToListing[listingId] = Listing(contractAddress, msg.sender, tokenId, price);
    }

    function purchase(uint256 listingId, uint256 amount) public payable {
        require(msg.value >= idToListing[listingId].price * amount, "Insufficient funds!");

        _itemsSold.increment();
        ERC1155 token = ERC1155(idToListing[listingId].contractAddress);

        token.safeTransferFrom(idToListing[listingId].seller, msg.sender, idToListing[listingId].tokenId, amount, "");
        payable(idToListing[listingId].seller).transfer(msg.value); //Transfering 98% to seller, fee 2%  ((msg.value/50)*49)
    }

    function  viewallListings() public view returns (Listing[] memory) {
        uint itemCount = _listingIds.current();
        uint unsoldItemCount = _listingIds.current() - _itemsSold.current();
        uint currentIndex = 0;

        Listing[] memory items = new Listing[](unsoldItemCount);

        for (uint i = 0; i < itemCount; i++) {
                uint currentId = i + 1;
                Listing storage currentItem = idToListing[currentId];
                items[currentIndex] = currentItem;
                currentIndex += 1;
        }

        return items;
    }

}
